import React, { useState, useEffect } from 'react';
import './App.css';
import { FaShoppingCart } from 'react-icons/fa';

const categories = [
  'All', 'Electronics', 'Wearables', 'Audio', 'Photography', 'Gaming', 'Computers', 'Tablets', 'Men', 'Women', 'Kids'
];

const sampleProducts = [
  { id: 1, name: 'Smart Watch', price: 99, category: 'Wearables' },
  { id: 2, name: 'Wireless Headphones', price: 59, category: 'Audio' },
  { id: 3, name: 'Gaming Mouse', price: 39, category: 'Gaming' },
  { id: 4, name: 'DSLR Camera', price: 499, category: 'Photography' },
  { id: 5, name: 'Laptop', price: 899, category: 'Computers' },
  { id: 6, name: 'Tablet', price: 299, category: 'Tablets' },
  { id: 7, name: "Men's T-Shirt", price: 19, category: 'Men' },
  { id: 8, name: "Women's Dress", price: 29, category: 'Women' },
  { id: 9, name: "Kids' Jacket", price: 25, category: 'Kids' },
];

function App() {
  const [cart, setCart] = useState(() => JSON.parse(localStorage.getItem('cart')) || []);
  const [category, setCategory] = useState('All');

  useEffect(() => {
    localStorage.setItem('cart', JSON.stringify(cart));
  }, [cart]);

  const filteredProducts = category === 'All'
    ? sampleProducts
    : sampleProducts.filter(p => p.category === category);

  const addToCart = (product) => {
    setCart(prev => {
      const exists = prev.find(item => item.id === product.id);
      if (exists) {
        return prev.map(item => item.id === product.id ? { ...item, qty: item.qty + 1 } : item);
      }
      return [...prev, { ...product, qty: 1 }];
    });
  };

  const removeFromCart = (id) => {
    setCart(prev => prev.filter(item => item.id !== id));
  };

  const updateQty = (id, qty) => {
    setCart(prev => prev.map(item => item.id === id ? { ...item, qty } : item));
  };

  return (
    <div className="container">
      <div className="hero mt-4">
        <h1>E-Commerce Store</h1>
        <p>Modern, responsive shopping experience. Browse by category and add to cart!</p>
      </div>
      <div className="category-filter mb-4">
        {categories.map(cat => (
          <button
            key={cat}
            className={`btn btn-category${category === cat ? ' active' : ''}`}
            onClick={() => setCategory(cat)}
          >
            {cat}
          </button>
        ))}
      </div>
      <div className="product-grid">
        {filteredProducts.map(product => (
          <div className="product-card" key={product.id}>
            <h5>{product.name}</h5>
            <p className="text-muted">{product.category}</p>
            <p className="fw-bold">${product.price}</p>
            <button className="btn btn-primary w-100" onClick={() => addToCart(product)}>
              Add to Cart
            </button>
          </div>
        ))}
      </div>
      <div className="cart">
        <h5><FaShoppingCart /> Cart ({cart.reduce((a, c) => a + c.qty, 0)})</h5>
        {cart.length === 0 ? <p className="text-muted">Cart is empty</p> : (
          <ul className="list-unstyled">
            {cart.map(item => (
              <li key={item.id} className="d-flex align-items-center mb-2">
                <span className="me-2">{item.name}</span>
                <input type="number" min="1" value={item.qty} onChange={e => updateQty(item.id, Number(e.target.value))} style={{ width: 50 }} className="form-control form-control-sm mx-2" />
                <button className="btn btn-danger btn-sm" onClick={() => removeFromCart(item.id)}>&times;</button>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
}

export default App;
